import React from "react";
import ReactDOM from "react-dom";
import Heading from "./Heading";
ReactDOM.render(
  <>
    <p>Friends</p>
    <ul>
      <li>Varun</li>
      <li>Shulabh</li>
      <li>Wasim</li>
      <li>Pintu</li>
    </ul>
  </>,
  document.getElementById("root")
);
